import Header from "./components/Header";
import SignIn from './pages/SignIn';
import * as React from "react";
import * as ReactDOM from "react-dom";
import {
  BrowserRouter,
  Routes,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Header />
      <main>
        <Routes>
          <Route path="/" element={<SignIn />} />

        </Routes>
      </main>
    </div>
  );
}

export default App;
